import React, { Component } from 'react';

const Number = [
  1,
  2,
  3,
  4,
  5,
  6,
  7,
  8,
  9,
  0,
  '+',
  '-',
  '*',
  '/',
  '%',
  '.',
  '=',
];

class Calculator extends Component {
  render() {
    console.log(Number);
    return (
      <div className="calculator">
        <input />
        <div className="input_btn">
          {Number.map((x) => {
            return (
              <button id={`input${x}`} key={`input${x}`}>
                {x}
              </button>
            );
          })}
        </div>
      </div>
    );
  }
}

console.log(Calculator());
export default Calculator;
